import Navbar from './components/Navbar';



function App() {
  return (
     <ChakraProvider >
      <Box bg="#f7f7f8"  color="white" minHeight="100vh">
      <Navbar />
     </Box>
      </ChakraProvider>
  );
}

export default App;
